import {BrowserRouter as Router, Routes, Route} from 'react-router-dom';
import {publicRoutes} from '~/routes/'

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
            <Route path='/' element={<Home/>}/>
        </Routes>
      </div>
    </Router>
  );
}

export default App;
